import React from 'react'

export function UsersModal({ users }) {
    return (
        <div className="user-modal">
            <div className="flex users-list-modal">
                {users.map(user => {
                    return <div className="flex align-center" >
                        <img className="img-users" src={user.color} />
                        <p>{user.name}</p>
                    </div>
                })}
            </div>
        </div>
    )
}
